import styled from 'styled-components'

export const StyledLi = styled.li`
	list-style-type: none;
	border-bottom: 1px solid black;
`
export const StyledUl = styled.ul`
	background-color: lightblue;
	list-style-type: none;
	display: flex;
	flex-direction: column;
	row-gap: 1rem;
`
